import React, { useEffect, useState } from "react";

const About = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users", {
      method: "GET",
    })
      .then((response) => {
        response.json();
      })
      .then((data) => {
        setUsers(data);
      })
      .catch((err) => {
        console.log(err);
      });
  });

  return (
    <div className="container">
      <h1>About</h1>
      {users.map((index) => (
        <div key={index.id}>
          <p>name :{index.name}</p>
        </div>
      ))}
    </div>
  );
};

export default About;
